import styled from "styled-components";

export const Heading = styled.h1`
  text-align: center;
  color: pink;
`;

export const Content = styled.div`
  overflowy: scroll;
  height: 2500px;
`;

export const Button = styled.div`
  position: fixed;
  width: 100%;
  left: 85%;
  bottom: 18%;
  height: 20px;
  font-size: 2rem;
  z-index: 1;
  cursor: pointer;
  color: green;
`;
